import torchaudio

"""
using officially extracted audios and torchaudio to load them
由于默认音频编码格式为.m4a(torchaudio不支持)，所以需要事先利用ffmpeg（使用同目录下的脚本convert_m4a_to_wav.sh）将其转为.wav
"""

dataset = "voxceleb2"
dataset_relative_path_auido = 'VoxCeleb2/audio/file~/dev/aac'
dataset_relative_path_video = 'VoxCeleb2/video/file~/dev/mp4'
data_path_audio = os.path.expanduser('~/AC/Dataset/{dataset_relative_path_auido}')
data_path_video = os.path.expanduser('~/AC/Dataset/{dataset_relative_path_video}')

save_dir = f'../saved/data/{dataset}/'
if not os.path.exists(save_dir):
    os.makedirs(save_dir)

# read
audio_file_ext = 'wav' # not 'm4a'
audio_files = sorted(glob.glob(os.path.join(data_path_audio,f'*/*/*.{audio_file_ext}')))
print(f'Total audios: {len(audio_files)}')

video_files = sorted(glob.glob(os.path.join(data_path_video,'*/*/*.mp4')))
print(f'Total videos: {len(video_files)}')

# check

video_sample_rate = 25
audio_sample_rate = 16000


