# test reading audio from official audio file using decord AudioReader
def process_one_audio(audio_file):
    video_file = audio_file.replace('audio/file~/dev/aac', 'video/file~/dev/mp4')
    video_file = video_file.replace(f'.{audio_file_ext}', '.mp4')
    if video_file[-len(example) - 4:-4] in broken_videos:
        return
    try:
        # load audio
        wav, sr = torchaudio.load(audio_file)
        assert sr == audio_sample_rate, f"==> Error: unexpected audio sample rate: {sr}, expected {audio_sample_rate}!"
        audio_duration = wav.shape[1] / audio_sample_rate
        # decord_ar = decord.AudioReader(audio_file, sample_rate=audio_sample_rate, mono=True)
        # audio_duration = decord_ar.shape[1] / audio_sample_rate
        # if decord_ar.shape[1] < 32000: # 2s
        #     print(f"==> warning: '{audio_file}' is less than 2s.")
        # video
        decord_vr = decord.VideoReader(video_file, num_threads=1)
        video_duration = len(decord_vr) / video_sample_rate
        assert abs(audio_duration - video_duration) < 0.1, f"==> warning: '{audio_file}' audio duration ({audio_duration}) != video duration ({video_duration})."
    except Exception as e:
        print(f"==> Note that '{audio_file}' is broken ('{e}')!")

